import { Sidebar } from "../components/Sidebar";
import { UserRanked } from "../components/UserRanked";

export const Ranking = () => {
  const users = [
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
    {
      name: "Amet Mattis Vulputate",
      rating: "60",
    },
  ];

  return (
    <div className="flex min-h-screen max-w-screen w-full h-full">
      <Sidebar />

      <div className="w-4/5 flex flex-col">
        <div className="relative">
          <div className="text-3xl text-[#000000] font-monoserrat font-bold mt-8 m-8">
            Ranking
          </div>
        </div>
      
        
          <div className="font-montserrat ml-12 text-left tracking-wide">Name</div>
          <div className="font-montserrat text-right tracking-wide mr-12">Rating</div>
      
        {users.map((item) => {
          return <UserRanked  image={item.image} name={item.name} rating={item.rating} />;
        })}
      </div>
    </div>
  );
};
